import React from "react";
import "./App.css";

class App extends React.Component {
  state = {
    name: "jason"
  };

  theArrow = () => {
    console.log("Is it working?");
  };

  render() {
    return <div className="App">{this.theArrow()}</div>;
  }
}

export default App;
